function Projects() {

    return(
        <div id="projects" className="">
            <h2 className="">Projects Tiled</h2>
            <ul>
                <li>Catan Tracker</li>
                <li>Game</li>
                <li>Weather Forecast</li>
                <li>GitHub Link</li>
            </ul>
            {/* <ProjectTile title="Catan Tracker"/> */}
            <ProjectsGroup />
        </div>
    )
}//end method

function ProjectsGroup() {
    const data = [{title : "Catan Tracker", body : "My Catan Tracking WPF app"}, {title: "Game", body : "Simple Game"}, {title : "Weather Forecast", body : "Api call to NWS and rendering response"}, {title: "GitHub Link", body : "Check out my GitHub"}]

    const group = data.map(tile =>         
        <ProjectTile 
            title={tile.title} 
            body={tile.body}            
        />
    )

    return (
        <div className="row">
            {group}
        </div>
    )
}

function ProjectTile(props){
// Catan Tracker -- Game -- Weather Forecast -- Github Link
    
    return (
        <div class="card m-1 p-1 col-sm-3">
            <img class="card-img-top" src="..." alt="Card image cap"/>
            <div class="card-body">
                <h3>{props.title}</h3>
                <p class="card-text">{props.body}</p>
            </div>
        </div>    
    )
}

export default Projects;
